INSERT INTO `catalog_product_entity_text` VALUES (2,85,0,2,'watch'),(3,76,0,2,'<p>Thức ăn bổ lông cho chó ANF Nature\'s Kitchen giàu axit béo, omega 3 (EPA+DHA) từ thành phần dầu cá hồi và cá tươi tự nhiên giúp làm mượt lông thú cưng. Axit béo trong hạt lanh giúp chăm sóc da và lông khỏe mạnh.</p>'),(4,75,0,2,'<p><strong>Thức ăn bổ lông cho chó ANF Nature\'s Kitchen</strong></p>\r\n<ul>\r\n<li>Thương hiệu: ANF</li>\r\n<li>Dòng sản phẩm: Nature\'s Kitchen</li>\r\n<li>Loại: <strong>Bổ lông, bổ da</strong></li>\r\n<li>Đối tượng: chó mọi lứa tuổi</li>\r\n<li>Khối lượng: 2 Kg</li>\r\n<li>Thành phần: gà nghiền khô, tăng trưởng cá hồi, đậu xanh, đậu lăng, men vi sinh, v.v.</li>\r\n<li>Công dụng: Giàu axit béo, omega 3 (EPA+DHA) từ thành phần dầu cá hồi và cá tươi tự nhiên giúp làm mượt lông thú cưng. Axit béo trong hạt lanh giúp chăm sóc da và lông khỏe mạnh.</li>\r\n</ul>'),(5,75,0,3,'<p><strong>Bánh thưởng cho chó Yaho hộp lớn</strong></p>\r\n<p> </p>\r\n<p>Thương hiệu Yaho</p>\r\n<p>Khối lượng 800 gram, gồm 6 gói bên trong, mỗi gói là một loại bánh thưởng khác nhau</p>\r\n<p>Là phần quà hấp dẫn dành cho các boss cưng của bạn, của người thân</p>\r\n<p>Bánh thưởng chứa nhiều dinh dưỡng và nhiều lợi ích: huấn luyện, thư giãn, làm sạch răng...</p>'),(6,85,0,3,'Bánh thưởng cho chó Yaho hộp lớn 800 gram (6 gói)'),(7,76,0,3,'<p>Bánh thưởng cho chó Yaho hộp lớn 800 gram có 6 gói bên trong, mỗi gói là một loại bánh thưởng khác nhau. Mua hộp lớn sẽ tiết kiệm hơn, boss thích hơn.</p>'),(8,75,0,4,'<p><strong>Pate cho chó Hug 400 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: nhập khẩu Thái Lan chính hãng</li>\r\n<li>Dành cho chó từ 2 tháng tuổi</li>\r\n<li>Giúp cún ăn ngon miệng, thay đổi khẩu phần bữa ăn, điều trị biếng ăn, cung cấp dinh dưỡng hoàn hảo.</li>\r\n<li>Thành phần: Gà, thịt đỏ cá ngừ, tinh bột sắn biến tính, đạm đậu nành, các loại vitamin, các loại khoáng chất, dicalcium, titanium dioxide, xanhthan gum, bột thạch carrageenan base.</li>\r\n<li>Chỉ tiêu chất lượng: Độ ẩm 85%, Protein thô 7%, Xơ 1%, Khoáng 3%, Béo 5%</li>\r\n<li>Số tiêu chuẩn công bố: TCCS 05:2020/GOTG.HCM</li>\r\n<li>Bảo quản nhiệt độ phòng, để ngăn mát dùng trong 48 tiếng sau khi mở nắp</li>\r\n</ul>'),(9,85,0,4,'Pate cho chó Hug 400 gram'),(10,76,0,4,'<p>Pate cho chó Hug 400 gram nhập khẩu Thái Lan là dạng thức ăn hỗn hợp chứa nhiều đạm, protein, khoáng chất, vitamin... giúp cún cưng ăn ngon miệng, phát triển khỏe mạnh.</p>'),(11,75,0,5,'<p><strong>Sữa bột cho chó Dr.Kyan Predogen</strong></p>\r\n<p> </p>\r\n<p>Sản xuất tại Việt Nam</p>\r\n<p>Khối lượng 110 gram</p>\r\n<p>Dùng cho chó con, chó sơ sinh,  chó mẹ đang mang thai, chó ốm yếu, chó bệnh cần hồi phục sức khỏe</p>\r\n<p>Bảo vệ thận, Nano Calcium, chắc xương, mượt lông, tăng miễn dịch</p>\r\n<p>Sữa bột cho chó Dr.Kyan Predogen được sản xuất theo công thức Wonderlife Pharma của Mỹ, là một thực phẩm bổ dưỡng cho cún yêu của bạn ngoài thức ăn thông thường, giúp cún cảm thấy ngon miệng, bồi bổ cơ thể và cung cấp những dưỡng chất cần thiết để phát triển toàn diện.</p>\r\n<p>Hướng dẫn sử dụng: in trên hộp</p>\r\n<p>Bảo quản nơi khô ráo thoáng mát, tránh ánh nắng trực tiếp</p>\r\n<p>Sữa đã pha có thể bảo quản ở ngắn mát tủ lạnh trong 24 tiếng</p>'),(12,85,0,5,'Sữa bột cho chó Dr.Kyan Predogen'),(13,76,0,5,'<div class=\"desc wb-content\">\r\n<p>Sữa bột cho chó Dr.Kyan Predogen được sản xuất theo công thức Wonderlife Pharma của Mỹ, là một thực phẩm bổ dưỡng cho cún yêu của bạn ngoài thức ăn thông thường, giúp cún cảm thấy ngon miệng, bồi bổ cơ thể...</p>\r\n</div>'),(14,75,0,6,'<p><strong>Thức ăn cho mèo con Catsrang Kitten 1.5 Kg</strong></p>\r\n<ul>\r\n<li>Thức ăn hạt cho mèo nhỏ Catsrang Kitten có nguồn gốc từ Hàn Quốc. Sản phẩm này áp dụng cho các chú mèo nhỏ, độ tuổi từ 4 đến 12 tháng. Cơ thể của các chú mèo lúc này yếu và cần nhiều chất như vitamin, chất khoáng, protein,...để cơ thể nhanh chóng phát triển cứng cáp.</li>\r\n<li>Catsrang Kitten giúp giải quyết một vấn đề vô cùng bất tiện mà hầu hết các chú mèo nhỏ đều gặp phải chính là vón lông ruột mèo. Vì cơ thể còn yếu, thiếu dưỡng chất nên bộ lông cũng chưa được mượt mà. Chính vì thế, các dưỡng chất cần thiết đã được bổ sung vào thức ăn để các bé mèo có thể tận hưởng thoải mái mà không lo còi xương, khó tiêu hay bị bết lông.</li>\r\n<li>Ngoài ra, ưu điểm nổi trội của loại sản phẩm này chính là tất cả các nguyên liệu đều được kiểm soát chặt chẽ. Không có chất bảo quản, chất kháng sinh, chất tạo mùi, tạo mùi hay hương liệu tổng hợp trong sản phẩm, Vì vậy, bạn có thể yên tâm sắm ngay một túi cho mèo cưng của mình nhé.</li>\r\n</ul>'),(15,85,0,6,'Thức ăn cho mèo con Catsrang Kitten 1.5 Kg'),(16,76,0,6,'<p>Thức ăn cho mèo con Catsrang Kitten có nguồn gốc từ Hàn Quốc. Sản phẩm này áp dụng cho các chú mèo nhỏ, độ tuổi từ 4 đến 12 tháng.</p>'),(17,75,0,7,'<p><strong>Bánh thưởng cho mèo Orgo</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Làm từ thành phẩn 100% tự nhiên, giàu dinh dưỡng, món ăn vặt yêu thích của tất cả mèo cưng</li>\r\n<li>Khối lượng 60 gram</li>\r\n<li>Loại: cá ngừ và gan gà</li>\r\n</ul>'),(18,85,0,7,'Bánh thưởng cho mèo Orgo 60 gram'),(19,76,0,7,'<p>Bánh thưởng cho mèo Orgo làm từ thành phẩn 100% tự nhiên, giàu dinh dưỡng, món ăn vặt yêu thích của tất cả mèo cưng.</p>'),(20,75,0,8,'<p><strong>Pate cho mèo Snappy Tom 400 gram</strong></p>\r\n<p> </p>\r\n<ul>\r\n<li>Xuất xứ: nhập khẩu Thái Lan chính hãng</li>\r\n<li>Dành cho mèo từ 2 tháng tuổi</li>\r\n<li>Giúp mèo ăn ngon miệng, thay đổi khẩu vị, điều trị biếng ăn, cung cấp dinh dưỡng hoàn chỉnh giúp mèo phát triển khỏe mạnh.</li>\r\n<li>Thành phần: Phụ phẩm gia cầm, bột gia cầm, cá ngừ, tinh bột kết dính, guar gum, Choline chloride, Calcium, taurin, Premix vitamin và khoáng chất.</li>\r\n<li>Số tiêu chuẩn công bố: TCCS 03:2019/GOTG.HCM</li>\r\n<li>Bảo quản nhiệt độ phòng, để ngăn mát và dùng hết trong 48 tiếng sau khi mở nắp</li>\r\n</ul>'),(21,85,0,8,'Pate cho mèo Snappy Tom 400 gram'),(22,76,0,8,'<p>Pate cho mèo Snappy Tom 400 gram là dạng thức ăn hỗn hợp hoàn chỉnh nhiều dinh dưỡng, đặc biệt thành phần Grain Free không ngũ cốc rất tốt cho sức khỏe mèo cưng của bạn.</p>'),(23,75,0,9,'<p><strong>Sữa cho mèo con Kitten Grow</strong></p>\r\n<p> </p>\r\n<p>Xuất xứ: Công ty Vedemin Việt Nam</p>\r\n<p>Khối lượng 100 gram / hộp</p>\r\n<p>Dùng được cho mèo từ 1 ngày tuổi, mèo mất mẹ, thiếu sữa</p>\r\n<p>Kitten Grow là sản phẩm sữa dinh dưỡng chứa các acid amin thiết yếu, cung cấp nguồn dinh dưỡng dễ tiêu hóa và hấp thu. Hỗ trợ cho sự tăng trưởng và phát triển khỏe mạnh của mèo con, mèo mất mẹ, chậm lớn, còi cọc.</p>\r\n<p>Cách dùng:</p>\r\n<p>Chuẩn bị nước ấm tỉ lệ 1 đun sôi + 1 nước nguội</p>\r\n<p>Khuấy đều đến khi tan hết sữa trong nước, cho mèo bú no. Ngày bú 1-2 lần.</p>\r\n<p>Liều lượng 25ml / 100 gram thể trọng / ngày</p>\r\n<p>Nếu dùng không hết có thể bảo quản ngăn mát tủ lạnh 24 tiếng, làm ấm lại trước khi cho mèo con uống.</p>'),(24,85,0,9,'Sữa cho mèo con Kitten Grow'),(25,76,0,9,'<p>Sữa cho mèo con Kitten Grow cung cấp nguồn dinh dưỡng dễ tiêu hóa, hấp thu. Bổ sung acid amin thiết yếu, giúp mèo con tăng trưởng và phát triển khỏe mạnh.</p>');
